  false,\n\t\"url\": null,\n\t\"notes\": \"This polygon layer represents floodplains
  created from FEMA Flood Rate Insurance Maps (FIRM). The layer can be symbolized
  to show the following flood hazard categories: Areas that are \"Floodways\" - (FLD_ZONE
  = 'AE' and FLOODWAY = 'Floodway') Areas of \"1 % Risk\" (aka 100-year flood zone)
  - (FLD_ZONE = 'A%' and FLOODWAY = '') Areas of \"0.2 % Risk\" (aka 500-year Flood
  Zone) - (FLD ZONE = '0.2 PCT ANNUAL CHANCE FLOOD HAZARD' and FLOODWAY = '') IDNR
  documentation states - u0093This database is an interim version of the Digital Flood
  Insurance Rate Map (DFIRM) Database. It does not fully meet all DFIRM specifications
  as found in u0093Guidelines and Specifications for Flood Hazard Mapping Partners,
  Appendix L: Guidance for Preparing Draft Digital Data and DFIRM Databaseu0094. \"The
  DFIRM Database is derived from Flood Insurance Studies (FISs), previously published
  Flood Insurance Rate Maps (FIRMs), flood hazard analyses performed in support of
  the FISs and FIRMs, and new mapping data, where available. The FISs and FIRMs are
  published by the Federal Emergency Management Agency (FEMA). The specifications
  for the horizontal control of DFIRM data files are consistent with those required
  for mapping at a scale of 1:12,000. \"The DFIRM Database presents the flood risk
  information depicted on the FIRM in a digital format suitable for use in electronic
  mapping applications. The DFIRM database is a subset of the Digital FIS database
  that serves to archive the information collected during the FIS.u0094\",\n\t\"owner_org\":
